import React, { useEffect, useState } from "react";
import { ReactDagEditor } from "react-dag-editor";

const LineagePage = () => {
  const [dagData, setDagData] = useState({
    nodes: [],
    edges: [],
  });

  useEffect(() => {
    // Fetch lineage data from your backend
    fetch('http://127.0.0.1:3000/lineage/model_1')
      .then((response) => response.json())
      .then((data) => {
        // Create nodes from fetched data
        const nodes = [
          { id: data.model, label: data.model },
          ...data.dependencies.map((dep) => ({
            id: dep,
            label: dep.charAt(0).toUpperCase() + dep.slice(1),
          })),
        ];

        // Create edges (connections) from fetched data
        const edges = data.dependencies.map((dep) => ({
          source: data.model,  // The current model is the source
          target: dep,         // Each dependency is a target
        }));

        setDagData({ nodes, edges });
      })
      .catch((error) => console.error("Error fetching lineage data:", error));
  }, []);

  const [state, setState] = useState({
    nodes: dagData.nodes,
    edges: dagData.edges,
  });

  const dispatch = (action: any) => {
    switch (action.type) {
      case "ADD_NODE":
        setState(prevState => ({
          ...prevState,
          nodes: [...prevState.nodes, action.node],
        }));
        break;
      case "REMOVE_NODE":
        setState(prevState => ({
          ...prevState,
          nodes: prevState.nodes.filter(node => node.id !== action.nodeId),
        }));
        break;
      default:
        break;
    }
  };

  return (
    <div>
      <h1>Lineage</h1>
      <ReactDagEditor
        state={state}
        dispatch={dispatch}
        style={{ width: "100%", height: "500px" }}
        handleWarning={(message) => console.warn(message)}
        handleError={(error, errorInfo) => console.error(error, errorInfo)}
      />
    </div>
  );
};

export default LineagePage;
